import React from "react";
import Card from './Card';


const CardList = ({ robots }) => {
    const cardComponents = robots.map((user, i) => {
        return <Card id={robots[i].id} name={robots[i].name} handle={robots[i].handle}/>
    })
    return (
        <div>
            <Card id={robots[0].id} name={robots[0].name} handle={robots[0].handle}/>
            <Card id={robots[1].id} name={robots[1].name} handle={robots[1].handle}/>
            <Card id={robots[2].id} name={robots[2].name} handle={robots[2].handle}/>
        </div>
    );
}

export default CardList;
